import React, { Component } from 'react'


class Maps extends Component {

    constructor() {
        super();
        this.state = {
            car: ['bmw', 'benz', 'tata']
        }

    }
    render() {
        return (
            <div>
                {this.state.car.map((item, index) => {
                    return (
                        <li style={ {float:left} }>{item}</li>
                    )
                })}
            </div>
        )
    }
}

export default Maps;
